(45658, 21238, 4212, 1, '01 為了將來', '', '2012-03-23 00:00:00', 2012, 0, 1, 7, '帶著心內的理想　看不清方向\r\n是要安怎來向前衝\r\n\r\n站穩我的腳步　面對未來的路\r\n不驚是有多辛苦\r\n\r\n總是要試看看　不通因為驚受到傷害\r\n世間無平穩的路　為了咱的將來\r\n\r\n放開咱的心　麥擱再去懷念過去\r\n為了將來作準備　創造人生的意義\r\n心裡賣空虛　一分一秒攏是金錢\r\n就要活出咱自己　總有一天會出頭天\r\n\r\n底啥米所在　有我的將來', '', 214, '', '', '', '', '', '', 0, 1, 0, '2012-03-23 01:35:32', '2015-03-12 13:51:24', '0000-00-00 00:00:00'),
(45659, 21238, 4212, 2, '02 你的陪伴', '', '2012-03-23 00:00:00', 2012, 0, 1, 7, '窗外的日頭漸漸照到我\r\n離開眠床上換好我的衫\r\n\r\n又割開始新ㄟㄧ天\r\n充滿著新的期待\r\n想要和你作陣去看海\r\n\r\n看　海鳥一群一群\r\n飛去新ㄟ所在\r\n親像咱找自己ㄟ未來\r\n互相扶持不怕阻礙\r\n有你的作伴\r\n就算未來路有多歹走\r\n大家的力量　風浪不算啥\r\n', '', 226, '', '', '', '', '', '', 1, 1, 0, '2012-03-23 01:40:08', '2015-03-12 13:51:24', '0000-00-00 00:00:00'),
