(45663, 21238, 4212, 3, '03 我是誰', '', '2012-03-23 00:00:00', 2012, 0, 1, 7, '這款問題　無需要感覺拍謝\r\n免去解釋　緊付出哩ㄟ身體\r\n\r\n隨著溫ㄟ音樂聲　動起你的腳步\r\n就麥去管太他　有什麼煩惱\r\n\r\n我是誰　看詳細\r\n', '', 225, '', '', '', '', '', '', 0, 1, 0, '2012-03-23 01:43:18', '2015-03-12 13:51:24', '0000-00-00 00:00:00'),
