(45669, 21238, 4212, 4, '04 隨風去', '', '2012-03-23 00:00:00', 2012, 0, 1, 7, '想到那一天　(想到咱的過去)\r\n你站在我面頭前　(我心內很傷悲)\r\n面對我的感情　(整天看未到你)\r\n你卻不能平靜　(一秒也未平靜)\r\n\r\n是不是對你的關愛　(是不是天公伯注定)\r\n親像大海浪　(折磨我的心)\r\n壓住你無法喘氣　(壓住我)\r\n才想要離開　(心情也未清)\r\n\r\n就給你　隨風去\r\n麥擱因為我來阻礙到你\r\n心　放乎開\r\n用到你的全心全意來證明\r\n創造自己ㄟ未來\r\n不需要愛情\r\n只剩我在這傻傻的等你\r\n', '', 240, '', '', '', '', '', '', 0, 1, 0, '2012-03-23 01:46:51', '2015-03-12 13:51:25', '0000-00-00 00:00:00'),
