(45671, 21238, 4212, 5, '05 賺無錢', '', '2012-03-23 00:00:00', 2012, 0, 1, 7, '今仔日天氣真好　甘麥嘎哇作陣出去\r\n挖賽丟挖ㄟ車　賣去倒位\r\n\r\n緊放棄你的煩惱　轉變作快樂的心情\r\n請你嘎哇作陣來唱歌\r\n\r\n親象雲隨風吹來吹去\r\n目的在哪裡\r\n不用去煩惱油錢有多貴\r\n雖然時機歹　就算賺無錢\r\n安心 自在 最美\r\n\r\n哇賺無錢　要安怎歡喜\r\n現實的壓力　算什麼\r\n', '', 177, '', '', '', '', '', '', 0, 1, 0, '2012-03-23 01:47:55', '2015-03-12 13:51:25', '0000-00-00 00:00:00'),
