(45734, 4354, 5770, 2, '櫻花季', '還記得曾經一起瘋狂夜遊的日子嗎?\n現在回想起來彷彿昨日般的清晰..\n相聚時的快樂，同樣也會有分離時的，哀愁。\n但回憶，會是我們一輩子的，羈絆。\n有緣再會了，我的朋友。\n\n--------------------------------------------------\n【Email】janmusic7@gmail.com\n【Blog】jan0777.pixnet.net/blog\n【FB】www.facebook.com/jan0777\n---------------------------------------------------', '2013-04-23 00:00:00', 2000, 15, 1, 4, '櫻花季\n\n每當這個季節  微風輕聲訴說 \n\n櫻花盛開飄偶而感到寂寞\n \n屏幕也會有他落幕的那一刻\n\n想起了旋律這樣唱著~\n\n \n一起走  櫻花盛開的時候\n\n驀然回首相聚的時候\n\n輕輕揮著手說你永遠不會忘記我\n\n微笑對我說 我們是永遠的朋友\n\n\n牽著手  笑說瘋狂的時候\n\n渡過你和我年少的執著\n\n落葉的微風揚起我們心中的感受\n\n啟程後的我  微笑的說著   我們會再見的~\n\n\n記憶會是我們心中天空\n\n啟程之後約好那道彩虹\n\n驀然回首我們再次相逢\n\n縱然分離偶而會傷痛\n\n\n詞:JAN鋒  曲:JAN鋒 編曲:JAN鋒 \n演唱:JAN鋒  合聲\\Mixing:JAN鋒', '', 327, '', 'JAN鋒', 'JAN鋒', 'JAN鋒', 'JAN鋒', '', 1, 1, 0, '2012-03-23 18:52:06', '2015-03-12 13:51:27', '0000-00-00 00:00:00'),
