(45736, 15059, 0, 1, '寂寞電台2012', '', '2012-03-23 00:00:00', 2000, 0, 2, 7, '寂寞電台\r\n\r\n今天早上醒來之後 我打開了收音機\r\n聽見了收音機傳來動人的歌曲\r\n有時候傷心 有時候開心\r\n我從這裡聽見了 一百種的情緒\r\n\r\n在這城市繁忙令人窒息的生活裡\r\n我從這裡找到了 生命的原動力\r\n拋開了壓力 擁抱了人群\r\n盡情享受充滿音樂給我帶來的活力\r\n\r\n也許你總是在夜深人靜時候傷心\r\n從今天之後暫停\r\n\r\n我們要 收聽寂寞電台每天都會在這裡\r\n把最熱情的電波送到你的心裡\r\n讓我們一起\r\n感受搖滾動力\r\n把最純粹的感動傳達給你\r\n我們在 這大都市中寂寞的夜空裡\r\n一直有我們在空中陪你\r\n只要你願意 打開了收音機\r\n寂寞電台就在這裡\r\n', '', 254, '', '張育嘉', '張育嘉', '', '', '', 1, 0, 0, '2012-03-23 23:33:16', '2015-03-12 13:51:27', '0000-00-00 00:00:00'),
