(45739, 15059, 0, 1, '最後的暗暝', '', '2012-03-23 00:00:00', 2000, 0, 2, 7, '最後的暗暝                                                  \r\n\r\n聽我講    心愛的    為何妳今夜要離去     \r\n明明知影  惦惦放手  雨潑目屎風隨 \r\n妳常講    牽咱的情   勇敢做夢  作夥去\r\n後伴絕情  當時的理想  勿通放棄      \r\n\r\n是命運     決心來撕逝\r\n還是妳     已跟好人生                                               \r\n賣擱相信   咱過去苦痴的戀情\r\n這是我     最後     給妳的歌曲\r\n\r\n請對我講  心愛的人  勿通頭回望離悲                                                    \r\n咱的過去  今放心腹底 永賣講起\r\n妳和我  夢過的夢  留我孤人對它眠                                           \r\n咱的笑面  當時的歡喜 心愛的妳\r\n\r\n為何妳    冷冷割開我的心                          \r\n還是決定   跟伊走人生  \r\n賣擱傷心   今夜咱落雨的戀情                                                   \r\n這是我 最後陪妳 的暗暝\r\n \r\n\r\n\r\n\r\n\r\n\r\n\r\n', '', 272, '', '張育嘉', '林正蔚', '', '', '', 1, 0, 0, '2012-03-23 23:41:00', '2015-03-12 13:51:27', '0000-00-00 00:00:00'),
(45740, 25248, 0, 1, '破綻', '', '2012-03-23 00:00:00', 2000, 0, 2, 5, '生命像是一場災難 運勢跌進谷底\r\n你沒有辦法怪罪任何人 除了你自己\r\n生活像是一片廢墟 心情掉進海底\r\n環顧四周圍的荒蕪 只剩下你自己\r\n\r\n即使你想盡辦法掩飾你自己\r\n依然有瞬間破綻洩漏了情緒\r\n你塑造形象成為一齣悲劇\r\n更沒有機會逃離', '', 363, '', '', '', '', '', '', 0, 1, 0, '2012-03-23 23:55:41', '2015-03-12 13:51:27', '0000-00-00 00:00:00'),
