(45747, 34442, 0, 1, '美好世界', '2009年精神健康創作大賽全國第二名', '2009-03-01 00:00:00', 0000, 0, 1, 4, '我要看的很遠 我要飛的更高 我要用的我力量去改變世界\n就算跌倒 也是動力的泉源\n不管環境惡裂 希望就在眼前 我要拋開所有勇敢面對明天 \n不要停歇 繼續向前 \n我要攀過高空的另一半 去尋找大家心中的期盼\n結果成功或失敗 都是必行的考驗 \n就差這一步 我就能跨越\n就差這一秒 我就能實現\n未來每一天 不想浪費\n奔向光榮的終點\n\n我要突破重圍 我要顛覆極限 我要用我的力量去改變一切\n如此堅絕(決) 愛是動力的泉源\n僅管夢是遙遠 我把失落璀毀 我要丟棄頹廢努力創造新鮮\n抱著信念 展翅高飛 \n我要飛過雲層的另一端 去尋找心中遺忘過的燦爛\n微笑 大聲吶喊 舞動生命的色彩\n踏出這一步 我就能跨越\n理想的藍圖 會慢慢實現 蛻變\n每一天 勇往直前\n奔向夢想的樂園\n\n也許成功太難 也許寂寞孤單 我想要的人生就是活的精采 \nJust do my best不斷超越 \n我要跨越彩虹的另一端 去尋找心中遺忘過的顏色\n生命 充滿期待 那是因為擁有愛\n狂風吹不散 希望的種子\n黑夜遮不了 心中的光芒\n未來每一刻 無限美好\n明天光明的燦爛\n', '', 266, '', '藍鬱', 'akko', '藍鬱', '', '', 0, 0, 0, '2012-03-24 04:59:12', '2015-03-12 13:51:27', '0000-00-00 00:00:00'),
(45748, 72723, 4000, 7, '我的世界－派派接招－小健健的詞', '', '2012-02-17 00:00:00', 2000, 0, 1, 7, '＜我的世界＞\r\n詞：林健富2012/02/17 \r\n曲：Patricia Shih 2012/03/11\r\n\r\nA1\r\n我曾經想放棄 　偶爾會無力 \r\n怪忙碌漸漸取代了自由 多麼可笑的理由 \r\n那是無法說出的苦衷 \r\n每當同伴一個個 離我遠走 \r\n只留下我自己一個人默默奮鬥 \r\n\r\nA2\r\n但我的世界 卻開不了口 \r\n因為音樂是我的所有 是我唯一的寄託 \r\n於是我開始尋找出口 \r\n不斷摸索 不斷地走 \r\n終於遇見 棉花糖好朋友 他們打開 我的窗口 \r\n\r\nB1\r\n他們要我別放棄 　 那個最初的夢 \r\n因為音樂是我的所有 \r\n常常會有一種 莫名的哀愁 \r\n好想大聲說 　我也想要快樂生活 \r\n\r\nB2\r\n他們告訴我 只要開朗面對 \r\n抬頭就會看到 蔚藍天空 \r\n人生還有很多 值得我們擁有 \r\n不要放棄 也別再逃避 \r\n\r\nB3\r\n他們說這個世界 仍然需要我 因為我還留著 這個夢\r\n因為我不想 讓夢還是夢 \r\n因為我的世界 音樂是所有 \r\n', '', 329, '', '', '', '', '', '', 0, 0, 0, '2012-03-24 13:43:06', '2015-03-12 13:51:27', '0000-00-00 00:00:00'),
