(45755, 3461, 4123, 2, '破壞', '', '2012-03-14 00:00:00', 2000, 0, 1, 7, '我在鏡子前努力看進自己的眼睛。 \r\n看見瞳孔裡面一盞包不住光的燈， \r\n慢慢跟著水波晃動，晃動，晃動， \r\n最後被一整團黑暗包噬。\r\n\r\n(破壞。)\r\n\r\n我被一條直穿而過白眼球的血絲牽引而出， \r\n流至邊境與成排江川匯流。 \r\n原來原先的我已達圓心。\r\n\r\n我不會再前進，但絕不後退。', '', 361, '', '陳誇張', '陳誇張', '陳誇張', '', '', 0, 0, 1, '2012-03-25 00:17:42', '2013-10-07 17:20:50', '0000-00-00 00:00:00'),
