(45757, 3461, 4123, 4, '癡', '', '2012-03-14 00:00:00', 2012, 0, 1, 5, '我被飢渴的慾望牽絆住了\r\n沒有理由與頭緒地就是要他 而且馬上！\r\n\r\n像褻瀆 也是自我淫醉\r\n\r\n在愛與慾間遊走 我們需要的不多\r\n卻不自覺地像黑洞般汲取再汲取、壓榨再壓榨', '', 259, '', '陳誇張', '陳誇張', '陳誇張', '', '', 0, 0, 1, '2012-03-25 00:33:42', '2013-10-07 17:20:50', '0000-00-00 00:00:00'),
