(45766, 134010, 0, 1, 'Don''tz', '', '2012-03-25 00:00:00', 2000, 0, 1, 1, '我只能醒著 沒甚麼好否則\n快變成空殼 眼神太清澈\n我開始凝望著 街道上的行人\n是否和我一樣這麼愚蠢\n\n我看著自己毀滅 燒完剩下的垂憐\n我突破了重圍 還是只看到黑夜\n我將自己毀滅 走向抽象的邊界\n讓我心中毀滅 才看到黑暗中的光線', '', 226, '', '', '', '', '', '', 1, 0, 0, '2012-03-25 11:58:50', '2015-03-12 13:51:27', '0000-00-00 00:00:00'),
