(45768, 72723, 3999, 21, '空屋－派派接招－海賊王的詞', '', '2012-02-17 00:00:00', 2000, 0, 1, 7, '<空屋>\r\n詞：蘇育霆2012/02/25\r\n曲：Patricia Shih2012/03/25\r\n\r\nA1\r\n郊區別墅 有城堡一樣的氣度\r\n裡面是否住著公主 足不出戶\r\nA2\r\n警衛制服 和騎士一樣的威武\r\n裡面是否關著女巫 要人戒護\r\nB\r\n如果關在裡面很孤獨\r\n就點燈告訴我 你在哪一戶\r\nC\r\n城堡座落幾處 沒有公主也沒(有)女巫\r\n警衛最大的用處 或許是澆花種樹\r\n屋大未必舒服  或者有錢也未必幸福\r\n自我安慰的好處 假裝過得很滿足\r\n\r\n曲序: A1-->A2-->B-->C-->A1-->A2-->B-->C-->C(升KEY)', '', 265, '', '', '', '', '', '', 0, 1, 0, '2012-03-25 18:50:23', '2015-03-12 13:51:27', '0000-00-00 00:00:00'),
(45769, 72723, 4000, 4, '音樂祭的制裁－搖滾豬接招－好自在的詞', '', '2012-02-17 00:00:00', 2000, 0, 1, 7, '＜音樂祭的制裁＞　\r\n詞：好自在2012/02/25\r\n曲：搖滾豬(Trump Wu)2012 /03 /25\r\n\r\nA.\r\n為了這個東西　我硬凹了三天假期\r\n管你什麼音樂　我性器官都聽不到\r\n為了這個東西　我勉強的揮手搖頭\r\n管你什麼音樂　我現在只想去碰撞\r\n\r\nB.\r\nHey~girl！你喜歡這一祭嗎\r\n說實在的我也喜歡妳這一齒\r\nHey~girl！你現在high不high呀\r\n喝個兩杯我們一起到別處high\r\n\r\nC.\r\n難得的音樂祭　你唱什麼東西\r\n難得的音樂祭　我根本就不想屌你\r\n難得的音祭祭　你唱什麼東西\r\n難得的音樂祭　我根本就沒空捧你\r\n\r\nA2.\r\n為了這個東西　我冒著很大的風險\r\n管你什麼音樂　把喇叭開大聲一點\r\n為了這個東西　到處有很大的危險\r\n管你什麼音樂　把燈光再調暗一點\r\n\r\nB2.\r\nHO~NO！怎麼會是Lesbian\r\n眼睜睜的看Tomboy把她帶走\r\nHO~NO！我不是一個Gay啦\r\nMacho Queen的大叔你別再靠近我\r\n\r\nC2.\r\n難得的音樂祭　我管你什麼風\r\n難得的音樂祭　你來抒情個什麼屁\r\n難得的音樂祭　我管你什麼咖\r\n難得的音樂祭　你介紹個什麼過去\r\n\r\nB3.\r\nHO~NO！怎麼會是一個Femme\r\n她旁邊的O-Le比保鑣還保鑣\r\nHO~NO！我真的不是個Gay\r\nDrag Queen　的大叔你別再靠近我\r\n\r\n尾.\r\n那邊的CC gay你他媽別再看我　FUCK\r\n\r\n※參考順序為↓\r\n前奏→A→B→C→A2→B2→C2→B3→尾', '', 246, '', '', '', '', '', '', 0, 0, 0, '2012-03-25 19:17:29', '2015-03-12 13:51:27', '0000-00-00 00:00:00'),
(45770, 72723, 3999, 25, '主唱－李維接招－啦啦的詞', '', '2012-02-17 00:00:00', 2000, 0, 1, 7, '＜主唱＞ \r\n詞：水漾貝啦 2012/3/10\r\n曲：李維 2012/03/25\r\n\r\n無需聳動的標題 不要驚心動魄的場景(驚心動魄的場景)\r\n殺戮鬥爭全平息 獨留真實感受的心靈(真實感受的心靈)\r\n\r\n每字每句的推砌 用盡全力在呼吸\r\n串連音符 灌注氧氣 旋律譜出 力量奇蹟\r\n\r\n血液沸騰心滾燙 脈搏噴張 靈魂擺盪\r\n就像雙腳(不由自主) 踩在 (這股力量) 太陽上\r\n\r\n我要大聲唱 唱出生命理想和希望\r\n我要用力唱 唱掉悲歡離合和哀傷\r\n我要大聲唱 唱出快樂現實和堅強\r\n\r\noh~oh~oh~oh~我要用力唱', '', 99, '', '', '', '', '', '', 0, 1, 0, '2012-03-25 21:04:02', '2015-03-12 13:51:27', '0000-00-00 00:00:00'),
