(45789, 143266, 0, 1, '北京冷雨夜', '', '2012-03-26 00:00:00', 2012, 20, 0, 4, '歌曲名 北京冷雨夜 演唱者 辽东笑笑生\r\n背着行囊走出地铁站\r\n想找一个温暖的地方过夜\r\n手中烟就象希望\r\n在黑暗中明明灭灭\r\n柔柔细雨轻轻飘洒\r\n陪我静静感受这沉默的夜\r\n冷风吹闪烁霓虹\r\n点缀只有我的长街\r\n北京冷雨夜北京冷雨夜\r\n谁能告诉我今宵何处停泊\r\n北京冷雨夜北京冷雨夜\r\n谁能告诉我何时不再漂泊\r\n坐在无人相伴汽车站\r\n数着站牌斑驳的时间地点\r\n晚班车就象希望\r\n在停靠后早已远离\r\n游游荡荡孤孤单单\r\n幻想能够摆出几分洒脱\r\n夜太浓轻声细雨\r\n难融无人懂的叹息\r\n北京冷雨夜北京冷雨夜\r\n谁能告诉我今生何处停泊\r\n北京冷雨夜北京冷雨夜\r\n谁能告诉我可否不再漂泊\r\n难道冥冥之中早已注定\r\n一生孤独冷清\r\n难道生活对我如此无情\r\n难道这就是命NO\r\n北京冷雨夜北京冷雨夜\r\n编织成落寞缠绕整个世界\r\n北京冷雨夜北京冷雨夜\r\n这就是生活我们终将低头', '', 310, '', '', '', '', '', '', 0, 1, 0, '2012-03-26 12:26:57', '2015-03-12 13:51:27', '0000-00-00 00:00:00');
